import React from 'react';
import EmployeeList from './components/employeeList';

class App extends React.Component {

    constructor(props) {
        super(props);
        this.state = {employees: []};
    }

    componentDidMount() {
        console.log("hesre")
        fetch('http://localhost:8080/api/restaurants/6/menu')
            .then(res => res.json())
            .then((data) => {
            console.log("here")
            this.setState({employees: data._embedded.dishes});
        });
    }

    render() {
        return (
            <EmployeeList employees={this.state.employees}/>
        )
    }
}

export default App;
